class Solution(object):
    def countCornerRectangles(self, grid):

        """
        :type grid: List[List[int]]
        :rtype: int
        """
        n = len(grid)
        m = len(grid[0])
        num = 0
        for i in range(n-1):
            tp = grid[i]
            yCandi = []
            for x1 in range(len(tp)):
                if tp[x1] == 1:
                    yCandi.append(x1)
            yCanLen =len(yCandi)
            for j1 in range(yCanLen):
                j = yCandi[j1]
                xCandi =[]
                for x1 in range(i+1 ,n):
                    if grid[x1][j]==1:
                        xCandi.append(x1)
                for k1 in range(j1+1,yCanLen):
                    k = yCandi[k1] -j
                    for r1 in xCandi:
                        if grid[r1][j+k] ==1:
                            num = num +1
        return num




